import react from "react";
import Title from "./Title";
import SignIn from "./buttons/signIn";
import Login from "./buttons/login";
function Header(){
return(
    <div className="TitleBar">
        <div>
        <Title/>
        </div>
        <div className="buttonBox">
            <SignIn/>
            <Login/>
        </div>
    </div>);
}
export default Header;
